import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
  row: {
    flexDirection: 'row',
    flexWrap: 'wrap'
  },
  marginRight: {
    marginRight: 10
  },
  marginBottom: {
    marginBottom: 10
  },
  alignCenter: {
    alignItems: 'center'
  }
});

export default styles;
